INSERT INTO `notice` VALUES ('1iv72mul112sk','안녕하세요 Mafiace 관리자입니다.\n기다리던 Mafiace 오픈이 시작됩니다. \n\n2022.02.18 정식 오픈!!!!!\n\n친구와 속고 속이는 마피아 게임~ \n가족, 친구, 동료 다 속여보세요~!\n\n- Sixman - ',1,'2022-02-15 18:18:39.483000','Mafiace 오픈!!! (2022-02-18)'),('to4mf7nlpe0h','안녕하세요, Mafiace 입니다.\n아이폰 업데이트 심사가 예상보다 늦어진 관계로 오늘 예정되어 있었던 업데이트 및 점검이 내일로 연기되었습니다.\n\n점검 일시 : 추후 공지\n\n해당 기간 동안 게임 이용이 제한될 예정입니다.\n\n\n불편을 끼쳐 죄송합니다.\n더욱더 좋은 서비스로 보답할 수 있도록 최선을 다하겠습니다. 감사합니다.\n ',2,'2022-02-15 18:19:26.640000','서버점검 연기 안내'),('vbeown0tgg1l',' Sixman!!\n\n김동현\n공윤환\n김종우\n연진우\n조영운\n천재원\n\nMafiace 많이 사랑해주세요~',3,'2022-02-15 18:21:13.711000','Mafiace 운영');
